import React from 'react';
import './App.css';
import Header from './components/Header/Header.jsx';
import UserCard from './components/Header/UserCard/UserCard';
import Navbar from './components/Navbar/Navbar.jsx';
import Profile from './components/Profile/Profile.jsx';

const App = () => {
  const massiv = ['post 3', 'post 4', 'post 5'];
  const posts = ['ava+description', 'My posts', 'post 1', 'post 2', 'post 3'];
  const nav = ['Profile', 'Messages', 'News', 'Music', 'Settings', 123];

  return (
    <div className="app-wrapper">
      <Header number="150" />
      <Navbar navigation={nav} />
      <UserCard />
      {/* <Profile alina={massiv} posts={posts} /> */}
    </div>
  );
};

export default App;
